      label: "$",
    },
    {
      value: "Transport",
      label: "€",
    }
   
  ];
  const categories2 = [
    {
      value: "Food",
      label: "$",
    },
    {
      value: "Transport",
      label: "€",
    }
   
  ];
  const type = [
    {
      value: "Income",
      label: "+",
    },
    {
      value: "Expense",
      label: "-",
    },
  ];
  return (
    <div>
      <TextField id="outlined-basic" label="Wallet Name" variant="outlined" />

      <TextField
        id="outlined-select-currency"
        select
        label="Type"
        helperText="Please select your type"
      >
        {type.map((option) => (
          <MenuItem key={option.value} value={option.value}>
            {option.label} {option.value}
          </MenuItem>
        ))}
